	var oVBI;
	var oModel = new sap.ui.model.json.JSONModel();
	oModel.setSizeLimit(99999);


	function onClusterClick(evt) {
		var oCluster = evt.oSource;
		var oTarget = evt.getParameter("instance").getItem();
		var oPopover = new sap.m.Popover({
			title : "Cluster Details",
			placement : "Right"
		});
		jQuery.sap.delayedCall(0, this, function() {
			oPopover.openBy(oTarget);
		})
	};

	function onClusterContextMenu(evt) {
		// context menu on cluster 
		var oMenu = evt.getParameter("menu");
		oMenu.addItem(new sap.ui.unified.MenuItem({
			text : "Any function"
		}));
		evt.getParameter("instance").openContextMenu(oMenu);
	};

	var cluster = new sap.ui.vbm.Cluster({
		type : sap.ui.vbm.SemanticType.Success,
		icon : "sap-icon://shipping-status"
	});
	// current workaround
	cluster.addEventDelegate({
		onAfterRendering : function(oEvent) {
			var oClusterInstance = oEvent.srcControl;
			var sRenderedClusterId = oClusterInstance.getId();
			var oVizObjMap = oClusterInstance.getParent().mVizObjMap;
			for ( var sClusterKey in oVizObjMap) {
				if (oVizObjMap[sClusterKey].getId() == sRenderedClusterId) {
					var oVBI = oClusterInstance.getParent().getParent();
					var spotIds = oVBI.getInfoForCluster(sClusterKey,
							sap.ui.vbm.ClusterInfoType.ContainedVOs);
					var aSpots = [];
					spotIds.map(function(spotId) {
						// AGGREGATING FUNCTION AROUND EVERY SPOT INSTANCE with JS .map()
						aSpots.push(oVBI.getVoByInternalId(spotId));
						// can access oVBI.getVoByInternalId(spotId).getBindingContext().getObject()
					});
					// FINAL TEXT
					oClusterInstance.setText("Count_" + aSpots.length);
				}
			}
		}
	});

	//create an instance of ClusterTree which will be used as our clustering mode
	oActualClustering = new sap.ui.vbm.ClusterDistance({
		rule : "status!=error",
		click : onClusterClick,
		vizTemplate : cluster,
		animateClusterSplit : false
	});
	oActualClustering.attachClick(onClusterClick);
	oActualClustering.attachContextMenu(onClusterContextMenu);

	// create analytic map and bind to model
	oVBI = new sap.ui.vbm.GeoMap('vbi', {
		initialPosition : "10;50;0",
		initialZoom : "4",
		vos : [
		new sap.ui.vbm.Spots("spots1", {
			customProperties : [ "status" ],
			items : {
				path : "/Spots",
				template : new sap.ui.vbm.Spot({
					text : '{key}',
					contentOffset : "0;-7",
					position : '{pos}',
					tooltip : '{tooltip}',
					type : '{type}',
					customData : [ new sap.ui.core.CustomData({
						key : "status",
						value : '{status}'
					}) ]
				})
			}
		}) ],
		clusters : [ oActualClustering ]
	});

	oVBI.setModel(oModel);
	oVBI.placeAt("content");
	oVBI.setMapConfiguration(JSON.parse(localStorage.getItem('map')));

	
	///// SECOND

			formatter : function (data) {
// 				return this.mClusterId;
				var oClusterInstance = this;
				var sRenderedClusterId = oClusterInstance.getId();

						var aSpots = [];
						spotIds.map(function (spotId) {
							aSpots.push(oVBI.getVoByInternalId(spotId));
						});
						return "Count_"+aSpots.length;
					}
